import React from 'react';

const Pairings = ({ diseaseData }) => {
  if (!diseaseData) {
    return <div>No data available.</div>;
  }

  return (
    <div className="pairings-container">
      <h2>{diseaseData.title || diseaseData.name || 'Health Benefits'}</h2>

      <div className="pairing-section">
        <h3>Vegetarian Pairings</h3>
        {diseaseData.vegetarian_pairings?.map((pair, idx) => (
          <div key={idx}>
            <p><strong>Foods:</strong> {pair.foods.join(' + ')}</p>
            <p><strong>Benefit:</strong> {pair.benefit}</p>
          </div>
        ))}
      </div>

      <div className="pairing-section">
        <h3>Non-Vegetarian Pairings</h3>
        {diseaseData.non_vegetarian_pairings?.map((pair, idx) => (
          <div key={idx}>
            <p><strong>Foods:</strong> {pair.foods.join(' + ')}</p>
            <p><strong>Benefit:</strong> {pair.benefit}</p>
          </div>
        ))}
      </div>

      <div className="pairing-section">
        <h3>Vegan Pairings</h3>
        {diseaseData.vegan_pairings?.map((pair, idx) => (
          <div key={idx}>
            <p><strong>Foods:</strong> {pair.foods.join(' + ')}</p>
            <p><strong>Benefit:</strong> {pair.benefit}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Pairings;
